template<typename A, typename B, typename C>
// curry takes a binary function from A and B to C
// returns a function which takes A and returns a function from B to C
function<function<C(B)>(A)> curry(function<C(A,B)> f) {
	return ( [=] (A x) {
		return ([=] (B y) {
			return f(x,y);
		});
	});
}

